// frontend/src/components/DropdownMenu.js
import React from 'react';

const DropdownMenu = () => {
  return (
    <div className="dropdown">
      <label>Select Asset</label>
      <select>
        <option>Asset 1</option>
        <option>Asset 2</option>
        <option>Asset 3</option>
      </select>
    </div>
  );
};

export default DropdownMenu;
